import React from "react";


const ChoiceButton = ({ type, choice, label, onChoice }) => {
  return (
  <div className="size text-">
    <div className={`btn btn-${type}`} onClick={onChoice.bind(this, choice)}>
      {label}
    </div></div>
  );
};

export default ChoiceButton;
